import React from 'react';
import s from './Friend.module.css'

const Friend = (props) => {

    return (

        <div className={`${s.sizeImage} ${s.color}`}>
            <div className={s.sizeImage}><img  src={props.image}/></div>
            <div>{props.name}</div>

        </div>


    );
};

export default Friend;
